import { Grid } from '@mui/material';
import { useQuery } from 'react-query';
import { RecipeCard } from '../../../components/RecipeCard';
import { Recipe } from '../../../types';
import { Loading } from '../../Loading/Loading';

export const HomeRecipeCard = () => {
  const { data: { recipes } = {}, isFetching } = useQuery(['test'], async () => {
    const res = await fetch(
      'https://api.spoonacular.com/recipes/random?apiKey=3a919f863b6f473e93b2473cdd0b6e3d',
    );
    return res.json();
  });
  console.log(recipes);

  return (
    <>
      {isFetching || !recipes ? (
        <Loading />
      ) : (
        <Grid container spacing={3}>
          {recipes.map(({ id, title, image }: Recipe) => (
            <RecipeCard id={123} title={'titel'} image='' discription='asdasdasd' />
          ))}
        </Grid>
      )}
    </>
  );

  return <RecipeCard id={123} title={'titel'} image='' discription='asdasdasd' />;
};
